import React from 'react';
import ReactDOM from 'react-dom';
import ForgeViewer,{launchViewer} from './js/ForgeViewer';

ReactDOM.render(
  <div>
    
    
    <div class="row center" id="forgeViewer"></div>
    <div id="openViewerBtn" class="btn">BUTTON</div>
    <div id="exportStepBtn" class="btn">BUTTON STEP</div>
  </div>,
  document.getElementById('root')
);

ForgeViewer.launchViewer();


